      CSD U2 L1 Overview:
        markdown: "# Vaaiga lautele\n\nO le lesoni lenei e faamatala le taua ma le
          aoga o se sooatulau, mo le tagata ma le na faia. O le vasega e vaavaai i
          sooatulau ua tele ona faaaoga i le Iunaite Setete ma e faamatala le aoga
          o fesootaiga taitasi i le tagata ma ala e aoga ai i le na faia le sooatulau.
          \n\n## Utuvagana\n\n* **Website** - O se nofoaga o fesootai ma le Upegatafailagi
          o loo iai se itulau se tasi pe sili atu i le Upega o Fesootaiga Faalelalolagi
          (World Wide Web)\n\n## Alagaoa\n\n*[O le Aoga o Sooatulau - Taiala] (https://docs.google.com/document/d/16M-x8qNr0tdpfoHqyKo4sdbTzFOy5rKp8IBYmTQ7xkU/export?format=pdf)"
