      CSD U2 L2 Overview:
        markdown: "# Vaaiga lautele \n\nO le lesona lenei e faailoa atu ai le faaaogaina
          o sooatulau o se ala e faaleo ai lagona o le tagata. E muamua ona talanoa
          le vasega i auala eseese e faasoa ma faailoa ai lagona ma manatu o tagata,
          ona vaai ai lea i ni faataitaiga o sooatulau na fausia lava e tamaiti aoga
          mai le vasega ua muamua atu. O le vaega mulimuli e tusi ma faasoa se lisi
          o ulutala ma lagona e aafia ai, faia o ni alagaoa e faaaoga mo se sooatulau
          o le tagata lava ia mo leisi vaega o totoe o le iunite. \n\n## Utuvagana
          - * **Website Content** O upu, ata ma isi vaega e tuu i totonu o le itulau
          a le upega\n\n## Alagaoa \n* [Tusiga Ata mo le Upega a le Tagata - Taiala]
          (https://docs.google.com/document/d/1wnK0ntxFWvUyuEB6SksiTtUDqrEhZZn3VPLWynz-fV4/export?format=pdf)
          \n\n "
        teacher_markdown: "* [Tusiga Ata mo le Upega a le Tagata] (https://docs.google.com/document/d/10zHN3SErzKQLNEvr8e0j2UVjPCR5oSQdrfoFpbZbJiU/edit?usp=sharing)
          - Faataitaiga ([PDF] \n(https://docs.google.com/document/d/10zHN3SErzKQLNEvr8e0j2UVjPCR5oSQdrfoFpbZbJiU/export?format=pdf)
          | [DOCX](https://docs.google.com/document/d/10zHN3SErzKQLNEvr8e0j2UVjPCR5oSQdrfoFpbZbJiU/export?format=doc))"
      CSD U2 L3 Overview:
        markdown: "# Vaaiga lautele \n\nO le lesona lenei e faailoa ai le HTML o se
          tali mo se faafitauli i le fessotaiga o faamaumauga ma le auivi o se sooatulau
          i se komepiuta. E amata le lesona i se galuega puupuu e faaali atu faafitauli
          i le lelei o le fesootaiga o se auivi o se itulau a le upega. E vaai i le
          vasega i le itulau a le HTML ma talanoa i ala e fesoasoani ai le HTML e
          foia lenei faafitauli, ona faaaoga ai le o le HTML e tusi ma faatulagai
          ai le uluai itulau o le upega mo le iunite. \n\n* **HTML** - Hypertext Markup
          Language, o se gagana poo tusitusiga e fau ai itulau mo le upega\n* **HTML
          Element** - O se vaega o le sooatulau, e faailo i se tag amata ma isi taimi
          e faaiu i se tag e tapuni ai. \n* **HTML Tag** - O ni mataitusi faapitoa
          e faailoa ai le amataga ma le faaiuga o se elemeni o le HTML ma i le ituaiga
          elemeni\n* **Website Content** - O upu, ata ma isi vaega e tuu i le itulau
          a le upega\n* **Website Structure** - O le autu o vaega eseese o faamaumauga
          i se itulau a le upega, e fesoasoani ai i le komepiuta e faavasega ala e
          faailoa ai faamaumauga\n\n## Faailo e Faailoa\n\n* **[HTML](//studio.code.org/docs/weblab/html/)**
          - `<html></html>`\n* **[Doctype](//studio.code.org/docs/weblab/doctype/)**
          - `<!DOCTYPE>`\n* **[Paragraph](//studio.code.org/docs/weblab/P/)** - `<p></p>`\n*
