      Unit 1 Lesson 1 Overview:
        markdown: "#Vaaiga lautele\nO le vasega e galulue i vaega e fai se vaa i le
          pepa alumini e mafai ona tali sene enaena se tele. O le uma ai o le lesoni
          e toe iloilo ma vaavaai iai vaega i a latou galuega sa fai ma galuega faatino
          ma fai ni fesootaiga i ituaiga galuega e latou te faia mo lenei pepa, i
          le sailiga o tali mo fesili ma le foia o faafitauli. \n\n#Alagaoa\n*[Vaa
          Alumini]\n(https://docs.google.com/document/d/1C5RMzH0811r8e2XdVbWV-GANm3uIar2_N8hI9jqX2rk/export?format=pdf)
          - Activity Guide (copy as [MS Word](https://docs.google.com/document/d/1C5RMzH0811r8e2XdVbWV-GANm3uIar2_N8hI9jqX2rk/export?format=doc),
          [Google Doc](https://docs.google.com/document/d/1C5RMzH0811r8e2XdVbWV-GANm3uIar2_N8hI9jqX2rk/copy))"
        teacher_markdown: |-
          [ki]
          * [Vaa Alumini - Faataitaiga](https://docs.google.com/a/code.org/document/d/1qHsuBxLTbCCUwjkUDKP0WywF249kx3s4aLeJyYR2Byo/edit?usp=sharing) - Activity Guide ([PDF](https://docs.google.com/document/d/1qHsuBxLTbCCUwjkUDKP0WywF249kx3s4aLeJyYR2Byo/export?format=pdf) | [DOCX](https://docs.google.com/a/code.org/document/d/1qHsuBxLTbCCUwjkUDKP0WywF249kx3s4aLeJyYR2Byo/edit?usp=sharing))
      Unit 1 Lesson 2 Overview:
        markdown: |-
          #Vaaiga Lautele
          I lenei lesona e te iloa ma malamalama ai le ala tatau e saili ai tali e fesoasoani ai ia te oe i le faatulagaina o se galuega mo ni ituaiga fesili eseese.
        teacher_markdown: "* [O ala i le Sailiga o Tali](https://docs.google.com/document/d/1lWv8fKJO2ZRvObUx6Ys1MTVqcSC5ZUfKI8RRXGayRpY/)
          - Activity Guide ([PDF](https://docs.google.com/document/d/1lWv8fKJO2ZRvObUx6Ys1MTVqcSC5ZUfKI8RRXGayRpY/export?format=pdf)
