      Unit 1 Lesson 3 Overview:
        markdown: |-
          #Vaaiga Lautele
          O lenei lesona e te iloa ai faatino le ala o sailiga o tali mo fesili faigata eseese ina ia iloa pe faapefea ona fesoasoani atu sitepu taitasi i le faalauteleina ma le faaleleiina o au tali i fesili.

          * [Sailiga o Tali - Taiala o Galuega Faatino](https://docs.google.com/document/d/1cym5lMuy41CbvXYe7F57N2XfI6Afp0hJsHovhR0GD2M/export?format=pdf)
